function setsubmit(idexfordate) {
    var chartDom3 = document.getElementById("word_count");
    var Word_count_chart = echarts.init(chartDom3);
    var word_option = {
        title: {
            text: "疫情词频",
            textStyle: {
                "color": "#ffffff",
            }
        },
        tooltip: {},
        legend: {
            data: ["词频"],
            textStyle: {
                "color": "#ffffff",
            }
        },
        xAxis: {
            data: word_data[idexfordate],
            axisLabel: {
                interval: 0,
                color: '#ffffff',
            },
        },
        grid: {
            top: "18%",
            left: "10%", // grid布局设置适当调整避免X轴文字只能部分显示
            right: "10%", // grid布局设置适当调整避免X轴文字只能部分显示
            bottom: "15%",
        },
        yAxis: {axisLabel: { color: '#ffffff' }},
        series: [
            {
                name: "词频",
                type: "bar",
                color: "#04aa6d",
                data: word_y[idexfordate],
            },
        ],
    };
    // 使用刚指定的配置项和数据显示图表。
    Word_count_chart.setOption(word_option);
    // scatter
    var chartDom = document.getElementById("emo_daily");
    var Emo_month = echarts.init(chartDom);
    var emo_month_option;

    const title = [];
    const singleAxis = [];
    const series = [];
    days.forEach(function (day, idx) {
        title.push({
            textBaseline: "middle",
            top: ((idx + 0.5) * 100) / 7 + "%",
            text: day,
        });
        singleAxis.push({
            left: 10,
            type: "category",
            boundaryGap: true,
            data: hours,
            top: (idx * 100) / 5 + 15 + "%",
            height: "40%",
            axisLabel: {
                interval: 0,
                fontSize: 20,
                color: "#ffffff",
            },
        });
        series.push({
            singleAxisIndex: idx,
            coordinateSystem: "singleAxis",
            type: "scatter",
            data: [],
            color: "#04aa6d",
            symbolSize: function (dataItem) {
                return dataItem[1] * 3;
            },
        });
    });

    senti_data[idexfordate].forEach(function (dataItem) {
        series[dataItem[0]].data.push([dataItem[1], dataItem[2]]);
    });

    emo_month_option = {
        tooltip: {
            position: "top",
        },
        title: {
            text: '舆论情绪占比对比图',
            
            textStyle: {
              "color": "#ffffff",
            },
            x:'center',
            y:'top',
            itemGap: 10,
          },
        singleAxis: singleAxis,
        series: series,
        
    };
    Emo_month.setOption(emo_month_option);
}
